import logo from './logo.svg';
import './App.css';
import './game/game.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button class="start-button" onclick="startGame()">Start Game</button>

      </header>
    </div>
  );
}

export default App;
